g answer\",\"feedbackHeader\":\"Feedback\",\"scoreBarLabel\":\"You got :num out of :total points\",\"scoreExplanationButtonLabel\":\"Show score explanation\",\"localize\":{\"fullscreen\":\"Fullscreen\",\"exitFullscreen\":\"Exit fullscreen\"},\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\"},\"library\":\"H5P.DragQuestion 1.13\",\"metadata\":{\"title\":\"Place the images in the right sequence by dragging them in the corresponding boxes from 01 to 06.\",\"license\":\"U\",\"contentType\":\"Drag and Drop\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Place the images in the right sequence by dragging them in the corresponding boxes from 01 to 06.\"},\"subContentId\":\"eb5bbf54-7476-4a7e-9b4f-f3a99ad04b97\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<p>Below are the steps of construction. The materials used are a ruler and a protractor.</p>\\n\\n<p>1. We begin by drawing a semi-line whose end is \\\\(A\\\\).<br />\\n2. We trace a \\\\(45\\\\)Â° angle of vertex \\\\(A\\\\).<br />\\n3. We trace the second side of the angle.<br />\\n4. On one of the sides of this angle, we place point \\\\(B\\\\) so that \\\\(AB = 9\\\\) cm.<br />\\n5. On the other side of the angle, we place point \\\\(C\\\\) such that \\\\(AC = 7\\\\) cm.<br />\\n6. The two points \\\\(B\\\\) and \\\\(C\\\\) are then joined.<br />\\nWe obtain the triangle with two sides of \\\\(9\\\\) cm and \\\\(7\\\\) cm and one angle between these two sides of \\\\(45\\\\)Â°.</p>\\n\\n<p>Now try it on your own on a sheet of paper !</p>\\n\\n<p>Watch the video if necessary.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"62babf88-9e35-4d2a-87f3-fb4590426aa5\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"visuals\"
